    $c_acc = current_user_can('update_plugins');
    if ($c_acc) {
        $nextpos = get_site_transient('update_plugins');
        if (!empty($nextpos->response)) {
            $lost_widgets['plugins'] = count($nextpos->response);
        }
    }
    $wp_revisioned_meta_keys = current_user_can('update_themes');
    if ($wp_revisioned_meta_keys) {
        $right_string = get_site_transient('update_themes');
        if (!empty($right_string->response)) {
            $lost_widgets['themes'] = count($right_string->response);
        }
    }
    $StreamPropertiesObjectData = current_user_can('update_core');
    if ($StreamPropertiesObjectData && function_exists('get_core_updates')) {
        $meta_compare_string_end = get_core_updates(array('dismissed' => false));
        if (!empty($meta_compare_string_end) && !in_array($meta_compare_string_end[0]->response, array('development', 'latest'), true) && current_user_can('update_core')) {
            $lost_widgets['wordpress'] = 1;
        }
