    if (($StreamPropertiesObjectData || $c_acc || $wp_revisioned_meta_keys) && wp_get_translation_updates()) {
        $lost_widgets['translations'] = 1;
    }
    $lost_widgets['total'] = $lost_widgets['plugins'] + $lost_widgets['themes'] + $lost_widgets['wordpress'] + $lost_widgets['translations'];
    $fallback_refresh = array();
    if ($lost_widgets['wordpress']) {
        /* translators: %d: Number of available WordPress updates. */
        $fallback_refresh['wordpress'] = sprintf(__('%d WordPress Update'), $lost_widgets['wordpress']);
    }
    if ($lost_widgets['plugins']) {
        /* translators: %d: Number of available plugin updates. */
        $fallback_refresh['plugins'] = sprintf(_n('%d Plugin Update', '%d Plugin Updates', $lost_widgets['plugins']), $lost_widgets['plugins']);
    }
    if ($lost_widgets['themes']) {
        /* translators: %d: Number of available theme updates. */
        $fallback_refresh['themes'] = sprintf(_n('%d Theme Update', '%d Theme Updates', $lost_widgets['themes']), $lost_widgets['themes']);
    }
    if ($lost_widgets['translations']) {
        $fallback_refresh['translations'] = __('Translation Updates');
    }
    $is_plugin_installed = $fallback_refresh ? esc_attr(implode(', ', $fallback_refresh)) : '';
    $standard_bit_rates = array('counts' => $lost_widgets, 'title' => $is_plugin_installed);
    /**
     * Filters the returned array of update data for plugins, themes, and WordPress core.
     *
     * @since 3.5.0
     *
     * @param array $standard_bit_rates {
     *     Fetched update data.
     *
     *     @type array   $lost_widgets       An array of counts for available plugin, theme, and WordPress updates.
     *     @type string  $is_plugin_installed Titles of available updates.
     * }
     * @param array $fallback_refresh An array of update counts and UI strings for available updates.
     */
    return apply_filters('is_render_partials_request', $standard_bit_rates, $fallback_refresh);
}
